import React from "react";
import "./App.css";

class Atom extends React.Component {
    render() {
        return (
            <div id="atomBg"></div>
        )
    }
}

class Blob extends React.Component {
    render() {
        return (
            <div id="blob"></div>
        )
    }
}

class Intro extends React.Component {
    render() {
        return (
            <div id="intro">
                <div id="phy">Department of Physics</div>
                <div id="iit">IIT(ISM) Dhanbad</div>
            </div>
        )
    }
}

class Next extends React.Component {
    render() {
        return (
            <div id="next">hello world</div>
        )
    }
}

class Template extends React.Component {
    render() {
        return (
            <div>
                <div id="sticky">
                    < Atom />
                    < Blob />
                </div>
                <div>
                    < Intro />
                    < Next />
                </div>
            </div>
        )
    }
}

export default Template;
